import React, { Component } from 'react';

import Chart from 'react-google-charts';

export default class Charts extends Component {
  render() {
    return (
      <Chart
        width={'500px'}
        height={'300px'}
        chartType="PieChart"
        loader={<div>Loading Chart</div>}
        data={[
          ['Task', 'Hours per Day'],
          ['Work', 11],
          ['Eat', 2],
          ['Commute', 2],
          ['Watch TV', 2],
          ['Sleep', 7],
        ]}
        options={{
          title: 'Continentes',
        }}
        rootProps={{ 'data-testid': '1' }}
      />
    );
  }
}
